import React, { Component } from 'react';
import Card from 'react-bootstrap/Card'


class CardProfile extends Component {
    render() {
        return (
            <div>
                <Card className="mt-5">
                    <Card.Body>This is some text within a card body.</Card.Body>
                </Card>
            </div>
        );
    }
}

export default CardProfile;
